MenuDef.definition:
{
    id: string;
    title?: string;
    inputPlaceholder?: string;
    hideSearchUntilActive?: boolean;
    nodes?: NodeDef<T>[];
    defaults?: MenuNodeDefaults<T>;
    ui?: {
        slots?: Partial<SurfaceSlots<T>>;
        slotProps?: Partial<SurfaceSlotProps>;
        classNames?: Partial<SurfaceClassNames>;
    };
}

GroupDef.definition:
BaseDef<'group'> & {
    nodes: (ItemDef<T> | SubmenuDef<any, any>)[];
    heading?: string;
}

ItemDef.definition:
BaseDef<'item'> & Searchable & {
    icon?: Iconish;
    /** Arman is a bitch. */
    data?: T;
    onSelect?: (args: {
        node: Omit<ItemNode<T>, 'onSelect'>;
        search?: SearchContext;
    }) => void;
    closeOnSelect?: boolean;
}

SubmenuDef.definition:
BaseDef<'submenu'> & Searchable & {
    nodes: NodeDef<TChild>[];
    data?: T;
    icon?: Iconish;
    title?: string;
    inputPlaceholder?: string;
    hideSearchUntilActive?: boolean;
    defaults?: MenuNodeDefaults<T>;
    ui?: {
        slots?: Partial<SurfaceSlots<TChild>>;
        slotProps?: Partial<SurfaceSlotProps>;
        classNames?: Partial<SurfaceClassNames>;
    };
}

Menu.definition:
Omit<MenuDef<T>, 'nodes'> & {
    nodes: Node<T>[];
    surfaceId: string;
    depth: number;
}

GroupNode.definition:
BaseNode<'group', GroupDef<T>> & {
    heading?: string;
    nodes: (ItemNode<T> | SubmenuNode<any>)[];
}

SubmenuNode.definition:
BaseNode<'submenu', SubmenuDef<T, TChild>> & Omit<SubmenuDef<T, TChild>, 'kind' | 'hidden' | 'nodes'> & {
    child: Menu<TChild>;
    nodes: Node<TChild>[];
}

SurfaceSlots.definition:
{
    Item: (args: {
        node: ItemNode<T>;
        search?: SearchContext;
        mode: Omit<ResponsiveMode, 'auto'>;
        bind: RowBindAPI;
    }) => React.ReactNode;
    Content: (args: {
        menu: Menu<T>;
        children: React.ReactNode;
        bind: ContentBindAPI;
    }) => React.ReactNode;
    Header?: (args: {
        menu: Menu<T>;
    }) => React.ReactNode;
    Input: (args: {
        value: string;
        onChange: (v: string) => void;
        bind: InputBindAPI;
    }) => React.ReactNode;
    Empty?: (args: {
        query: string;
    }) => React.ReactNode;
    List: (args: {
        children: React.ReactNode;
        bind: ListBindAPI;
    }) => React.ReactNode;
    Footer?: (args: {
        menu: Menu<T>;
    }) => React.ReactNode;
    SubmenuTrigger: (args: {
        node: SubmenuNode<T>;
        search?: SearchContext;
        bind: RowBindAPI;
    }) => React.ReactNode;
}

SurfaceSlotProps.definition:
{
    content?: React.HTMLAttributes<HTMLElement>;
    header?: React.HTMLAttributes<HTMLElement>;
    input?: React.InputHTMLAttributes<HTMLInputElement>;
    list?: React.HTMLAttributes<HTMLElement>;
    footer?: React.HTMLAttributes<HTMLElement>;
}

SurfaceClassNames.definition:
{
    root?: string; // (reserved) if you wrap the entire surface
    content?: string;
    input?: string;
    list?: string;
    item?: string;
    subtrigger?: string;
    group?: string;
    groupHeading?: string;
}

ShellSlotProps.definition:
{
    drawerRoot?: Partial<React.ComponentProps<typeof Drawer.Root>>;
    drawerOverlay?: React.ComponentPropsWithoutRef<typeof Drawer.Overlay>;
    drawerContent?: React.ComponentPropsWithoutRef<typeof Drawer.Content>;
}

ShellClassNames.definition:
{
    root?: string;
    overlay?: string;
    drawerContent?: string;
    drawerHandle?: string;
    trigger?: string;
}

CreateActionMenuOptions.definition:
{
    /** Default content-level options such as `vimBindings` and `dir`. */
    defaults?: {
        content?: Pick<ActionMenuSurfaceProps<T>, 'vimBindings' | 'dir' | 'onCloseAutoClear'>;
    };
    surface?: {
        slots?: Partial<SurfaceSlots<T>>;
        slotProps?: Partial<SurfaceSlotProps>;
        classNames?: Partial<SurfaceClassNames>;
    };
    /** NEW: Defaults for the Vaul/overlay shell. */
    shell?: {
        classNames?: Partial<ShellClassNames>;
        slotProps?: Partial<ShellSlotProps>;
    };
}

CreateActionMenuResult.definition:
{
    Root: React.FC<ActionMenuProps>;
    Trigger: typeof Trigger;
    Positioner: typeof Positioner;
    Surface: React.ForwardRefExoticComponent<ActionMenuSurfaceProps<T> & React.RefAttributes<HTMLDivElement>>;
}

SearchContext.definition:
{
    query: string;
    isDeep: boolean;
    breadcrumbs: string[];
    breadcrumbIds: string[];
}

RowBindAPI.definition:
{
    focused: boolean;
    disabled: boolean;
    getRowProps: <T extends React.HTMLAttributes<HTMLElement>>(overrides?: T) => T & {
        ref: React.Ref<any>;
        id: string;
        role: 'option';
        tabIndex: -1;
        'data-action-menu-item-id': string;
        'data-focused'?: 'true';
        'aria-selected'?: boolean;
        'aria-disabled'?: boolean;
    };
}

ContentBindAPI.definition:
{
    getContentProps: <T extends React.HTMLAttributes<HTMLElement>>(overrides?: T) => T & {
        ref: React.Ref<any>;
        role: 'menu';
        tabIndex: -1;
        'data-slot': 'action-menu-content';
        'data-state': 'open' | 'closed';
        'data-action-menu-surface': true;
        'data-surface-id': string;
    };
}

InputBindAPI.definition:
{
    getInputProps: <T extends React.InputHTMLAttributes<HTMLInputElement>>(overrides?: T) => T & {
        ref: React.Ref<any>;
        role: 'combobox';
        'data-slot': 'action-menu-input';
        'data-action-menu-input': true;
        'aria-autocomplete': 'list';
        'aria-expanded': true;
        'aria-controls'?: string;
        'aria-activedescendant'?: string;
    };
}

ListBindAPI.definition:
{
    getListProps: <T extends React.HTMLAttributes<HTMLElement>>(overrides?: T) => T & {
        ref: React.Ref<any>;
        role: 'listbox';
        id: string;
        tabIndex: number;
        'data-slot': 'action-menu-list';
        'data-action-menu-list': true;
        'aria-activedescendant'?: string;
    };
    getItemOrder: () => string[];
    getActiveId: () => string | null;
}
